import React, { Component } from "react";

import "./index.css";

class CsvUpload extends Component {
  handleFileUpload = async (event) => {
    try {
      const file = event.target.files[0];
      const formData = new FormData();
      formData.append("csvFile", file);

      const response = await fetch("http://localhost:4000/upload-csv", {
        method: "POST",
        body: formData,
      });

      if (response.ok) {
        alert("CSV file uploaded successfully!");
      } else {
        throw new Error("Failed to upload CSV file");
      }
    } catch (error) {
      console.error("Error uploading CSV file:", error.message);
      alert("Error uploading CSV file. Please try again.");
    }
  };

  render() {
    return (
      <div className="upload-csv">
        <div>
          <h2>Upload CSV File</h2>
          <input type="file" accept=".csv" onChange={this.handleFileUpload} />
        </div>
      </div>
    );
  }
}

export default CsvUpload;
